import React from "react";
import './Card.css'

let prevId = 1

export default function Card({image, name, weight, temperaments}){

   return (
    <div className="card">
    <div >
        <img className="cardImage" src={image} alt='not found' width="200px" height="250px" />
    </div>
    <div>
        <h2 className="cardName">{name}</h2>
    </div>
    {/* <div>
        <h5 className="cardName">weight:{weight}</h5>
       
    </div> */}
    <div className="cardDiet">
        {temperaments?.map(el =>{
            return (
                <h6 className="dietsCard" key = {prevId++}>{el.name? el.name : el}</h6>
            )
        })}
    </div>
    </div>
   )
}
